import React from 'react';
import './header.css';

const Header = () => {
  return(
    <div className="stars__header section__padding" id="home">
      <div className="stars__header-content">
        <h1 className="gradient__text">Open up the universe to others</h1>
      </div>
    </div>
  )
}

export default Header
